processors = [1 2 4 6 8 16];k10_runtimes = [38.11 23.25 16.41 14.06 19.53 35.21];k40_runtimes = [208.52 109.68 44.10 33.08 33.71 49.43];k160_runtimes = [  180.78];k10_speedup = (repmat(k10_runtimes(1), 1, 6) ./ k10_runtimes);k10_efficiency = k10_speedup ./ processors;k40_speedup = (repmat(k40_runtimes(1), 1, 6) ./ k40_runtimes);k40_efficiency = k40_speedup ./ processors;f = figure;hold on;title('Efficiency');xlabel('Processors in Cluster');ylabel('Efficiency');plot(processors, k10_efficiency, 'Color', 'blue', 'LineWidth', 3);plot(processors, k40_efficiency, 'Color', 'green', 'LineWidth', 3);plot(processors, repmat([1], 1, 6), 'Color', 'red', 'LineWidth', 3);legend('10k Training Images', '40k Training Images', '1:1 Speedup');saveas(f, 'efficiency.png');g = figure;hold on;axis equal;title('Speedup');xlabel('Processors in Cluster');ylabel('Speedup');plot(processors, k10_speedup, 'Color', 'blue', 'LineWidth', 3);plot(processors, k40_speedup, 'Color', 'green', 'LineWidth', 3);plot(processors, processors, 'Color', 'red', 'LineWidth', 3);legend('10k Training Images', '40k Training Images', '1:1 Speedup');saveas(g, 'speedup.png');